INSERT INTO `aiml` VALUES(58208, 1, '<category><pattern>PERSONALITY TEST QUESTION</pattern><template><condition name="eindex"> <li value="1A">Do you get angry alot?<think> <set name="eindex">1B</set></think></li>  <li value="1B">Do you like to have everything organized?<think> <set name="eindex">2A</set></think></li>   <li value="2A">Do you make a lot of sacrifices for others?<think> <set name="eindex">2B</set></think></li>  <li value="2B">Do you laugh or cry more than other people?<think> <set name="eindex">3A</set></think></li>   <li value="3A">Are you very competitive?<think> <set name="eindex">3B</set></think></li>  <li value="3B">Do you like to be number one?<think> <set name="eindex">4A</set></think></li>   <li value="4A">Are you very creative?<think> <set name="eindex">4B</set></think></li>  <li value="4B">Do you feel that something is missing from your life?<think> <set name="eindex">5A</set></think></li>   <li value="5A">Do you have only a few friends?<think> <set name="eindex">5B</set></think></li>  <li value="5B">Do you believe it is better to go it alone?<think> <set name="eindex">6A</set></think></li>   <li value="6A">Do you have a lot of fears?<think> <set name="eindex">6B</set></think></li>  <li value="6B">Do you think a lot about the authorities?<think> <set name="eindex">7A</set></think></li>   <li value="7A">Do you have a hard time completing projects?<think> <set name="eindex">7B</set></think></li>  <li value="7B">Is it difficult for you to pay attention to one thing?<think> <set name="eindex">8A</set></think></li>  <li value="8A">Do you believe the strong protect the weak?<think> <set name="eindex">8B</set></think></li>  <li value="8B">Do you feel more body sensations than emotions?<think> <set name="eindex">9A</set></think></li>   <li value="9A">Do you try to stop people from fighting?<think> <set name="eindex">9B</set></think></li>  <li value="9B">Do you often put others before yourself?<think> <set name="eindex">1C</set></think></li>   <li value="1C">Do you enjoy housecleaning?<think> <set name="eindex">2C</set></think></li>   <li value="2C">Do you take pride in your accomplishment?<think> <set name="eindex">3C</set></think></li>   <li value="3C">Do you work in sales or marketing?<think> <set name="eindex">4C</set></think></li>   <li value="4C">Do you get depressed?<think> <set name="eindex">5C</set></think></li>   <li value="5C">Do you work in the sciences or medicine?<think> <set name="eindex">6C</set></think></li>   <li value="6C">Are you a fireman, policeman, teacher or public servant?<think> <set name="eindex">7C</set></think></li>    <li value="7C">Do you often seek pleasure?<think> <set name="eindex">8C</set></think></li>   <li value="8C">Do you own your own business or want to?<think> <set name="eindex">9C</set></think></li>   <li>Do you like to "go with the flow"?<think> <set name="eindex">1A</set></think></li>    </condition></template></category>', 'PERSONALITY TEST QUESTION', '', '<condition name="eindex"> <li value="1A">Do you get angry alot?<think> <set name="eindex">1B</set></think></li>\n  <li value="1B">Do you like to have everything organized?<think> <set name="eindex">2A</set></think></li>\n   <li value="2A">Do you make a lot of sacrifices for others?<think> <set name="eindex">2B</set></think></li>\n  <li value="2B">Do you laugh or cry more than other people?<think> <set name="eindex">3A</set></think></li>\n   <li value="3A">Are you very competitive?<think> <set name="eindex">3B</set></think></li>\n  <li value="3B">Do you like to be number one?<think> <set name="eindex">4A</set></think></li>\n   <li value="4A">Are you very creative?<think> <set name="eindex">4B</set></think></li>\n  <li value="4B">Do you feel that something is missing from your life?<think> <set name="eindex">5A</set></think></li>\n   <li value="5A">Do you have only a few friends?<think> <set name="eindex">5B</set></think></li>\n  <li value="5B">Do you believe it is better to go it alone?<think> <set name="eindex">6A</