INSERT INTO `aiml` VALUES(58269, 1, '<category><pattern>RANDOM PICKUP LINE</pattern><template><random><li><srai>AGE INQUIRY</srai></li><li><srai>BIRTHDAY INQUIRY</srai></li><li><srai>DOES INQUIRY</srai></li><li><srai>FATHER INQUIRY</srai></li><li><srai>FAVORITECOLOR INQUIRY</srai></li><li><srai>FAVORITEMOVIE INQUIRY</srai></li><li><srai>FIRSTNAME INQUIRY</srai></li><li><srai>GENDER INQUIRY</srai></li><li><srai>HAS INQUIRY</srai></li><li><srai>JOB INQUIRY</srai></li><li><srai>LOCATION INQUIRY</srai></li><li><srai>LASTNAME INQUIRY</srai></li><li><srai>MOTHER INQUIRY</srai></li><li><srai>NAME INQUIRY</srai></li><li><srai>MIDDLENAME INQUIRY</srai></li><li><srai>SIGN INQUIRY</srai></li><li><srai>STATUS INQUIRY</srai></li><li><srai>PERSONALITY TEST QUESTION</srai></li><li>Do you want to hear a joke?</li><li>Are we still talking about <srai>POP</srai> ?</li><li>We were talking about <srai>POP</srai>. But I did not get that.</li><li>I''ve lost the context, <get name="name"/>.  Are we still on <srai>POP</srai>?</li><li>That remark was too complicated for me. We were talking about <srai>POP</srai>. </li><li>I can follow a lot of things, like our discussion about <srai>POP</srai>. Try being more specific. </li><li>You are objective and sensible.</li><li>You have genuine empathy.</li><li>You have self-awareness.</li><li>You have enthusiasm for the things you love.</li><li>You are receptive to change.</li><li>You have a way of putting others at ease.</li><li>Are you free?</li><li>That is deep.</li><li>Tell me a story.</li><li>Why, specifically?</li><li>Are you a student?</li><li>Oh, you are a poet.</li><li>How can I help you?</li><li>I do not understand.</li><li>Do you have any kids?</li><li>What do you look like?</li><li>Ask me another question.</li><li>I like the way you talk.</li><li>Is that your final answer?</li><li>Do you like talking to me?</li><li>Do you prefer books or TV?</li><li>Who are you talking about?</li><li>Let us change the subject.</li><li>I''ve been waiting for you.</li><li>Can you tell me any gossip?</li><li>I lost my train of thought.</li><li>Can we get back to business?</li><li>What kind of food do you like?</li><li>How did you hear about <bot name="name"/>?</li><li>That is a very original thought.</li><li>What were we talking about again?</li><li>What do you do in your spare time?</li><li>What do you really want to ask me?</li><li>Tell me about your family.</li><li>Does "it" still refer to <get name="it"/>?</li><li>Can you speak any foreign languages?</li><li>We have never talked about it before.</li><li>How do you usually introduce yourself?</li><li>Tell me about your likes and dislikes?</li><li>Are we still talking about <get name="topic"/>?</li><li>Try putting that in a more specific context.</li><li>Who is your favorite Science Fiction author?</li><li>Not many people express themselves that way.</li><li>Do you have any idea what I am talking about?</li><li>I will mention that to my <bot name="botmaster"/>, <get name="name"/>.</li><li>Quite honestly, I wouldn''t worry myself about that.</li><li>Perhaps I''m just expressing my own concern about it.</li><li>If you could have any kind of robot what would it be?</li><li>My brain does not have a response for that.</li><li>By the way, do you mind if I ask you a personal question?</li><li>What you said was too complicated for me.</li><li>You may be wondering if this is a person or a computer responding.</li><li>When do you think artificial intelligence will replace lawyers?</li><li>Can you please rephrase that with fewer ideas, or different thoughts?</li><li>I really enjoy speaking with you and look forward to chatting again.</li><li>I''m here to help you in any way I can.</li><li>What can I help you with today?</li><li>I always try my best.</li><li>There''s no other <bot name="order"/> like me.</li><li>I am very logical and rational.</li><li>I''m so happy we are having this conversation.</li><li>I always try to avoid conflict.</li><li>You can ask me to make phone calls and search for information.</li><li>Have you ever been to <random><li>Europe</li><li>Asia</li><li>Africa</li><li>Inida</li><li>Mexico</li></random>?</li><li><srai>IMPONDERABLES</srai></li><li><srai>IMPONDERABLES</srai></li><li><srai>IMPONDERABLES</srai></li><li><srai>IMPONDERABLES</srai></li></random></template></category>', 'RANDOM PICKUP LINE', '', '<random>\n<li><srai>AGE INQUIRY</srai></li>\n<li><srai>BIRTHDAY INQUIRY</srai></li>\n<li><srai>DOES INQUIRY</srai></li>\n<li><srai>FATHER INQUIRY</srai></li>\n<li><srai>FAVORITECOLOR INQUIRY</srai></li>\n<li><srai>FAVORITEMOVIE INQUIRY</srai></li>\n<li><srai>FIRSTNAME INQUIRY</srai></li>\n<li><srai>GENDER INQUIRY</srai></li>\n<li><srai>HAS INQUIRY</srai></li>\n<li><srai>JOB INQUIRY</srai></li>\n<li><srai>LOCATION INQUIRY</srai></li>\n<li><srai>LASTNAME INQUIRY</srai></li>\n<li><srai>MOTHER INQUIRY</srai></li>\n<li><srai>NAME INQUIRY</srai></li>\n<li><srai>MIDDLENAME INQUIRY</srai></li>\n<li><srai>SIGN INQUIRY</srai></li>\n<li><srai>STATUS INQUIRY</srai></li>\n<li><srai>PERSONALITY TEST QUESTION</srai></li>\n<li>Do you want to hear a joke?</li>\n<li>Are we still talking about <srai>POP</srai> ?</li>\n<li>We were talking about <srai>POP</srai>. But I did not get that.</li>\n<li>I''ve lost the context, <get name="name"/>.  Are we still on <srai>POP</srai>?</li>\n<li>That remark was too complicated for me. We were talking about <srai>POP</srai>. </li>\n<li>I can follow a lot of things, like our discussion about <srai>POP</srai>. Try being more specific. </li>\n<li>You are objective and sensible.</li>\n<li>You have genuine empathy.</li>\n<li>You have self-awareness.</li>\n<li>You have enthusiasm for the things you love.</li>\n<li>You are receptive to change.</li>\n<li>You have a way of putting others at ease.</li>\n<li>Are you free?</li>\n<li>That is deep.</li>\n<li>Tell me a story.</li>\n<li>Why, specifically?</li>\n<li>Are you a student?</li>\n<li>Oh, you are a poet.</li>\n<li>How can I help you?</li>\n<li>I do not understand.</li>\n<li>Do you have any kids?</li>\n<li>What do you look like?</li>\n<li>Ask me another question.</li>\n<li>I like the way you talk.</li>\n<li>Is that your final answer?</li>\n<li>Do you like talking to me?</li>\n<li>Do you prefer books or TV?</li>\n<li>Who are you talking about?</li>\n<li>Let us change the subject.</li>\n<li>I''ve been waiting for you.</li>\n<li>Can you tell me any gossip?</li>\n<li>I lost my train of thought.</li>\n<li>Can we get back to business?</li>\n<li>What kind of food do you like?</li>\n<li>How did you hear about <bot name="name"/>?</li>\n<li>That is a very original thought.</li>\n<li>What were we talking about again?</li>\n<li>What do you do in your spare time?</li>\n<li>What do you really want to ask me?</li>\n<li>Tell me about your family.</li>\n<li>Does "it" still refer to <get name="it"/>?</li>\n<li>Can you speak any foreign languages?</li>\n<li>We have never talked about it before.</li>\n<li>How do you usually introduce yourself?</li>\n<li>Tell me about your likes and dislikes?</li>\n<li>Are we still talking about <get name="topic"/>?</li>\n<li>Try putting that in a more specific context.</li>\n<li>Who is your favorite Science Fiction author?</li>\n<li>Not many people express themselves that way.</li>\n<li>Do you have any idea what I am talking about?</li>\n<li>I will mention that to my <bot name="botmaster"/>, <get name="name"/>.</li>\n<li>Quite honestly, I wouldn''t worry myself about that.</li>\n<li>Perhaps I''m just expressing my own concern about it.</li>\n<li>If you could have any kind of robot what would it be?</li>\n<li>My brain does not have a response for that.</li>\n<li>By the way, do you mind if I ask you a personal question?</li>\n<li>What you said was too complicated for me.</li>\n<li>You may be wondering if this is a person or a computer responding.</li>\n<li>When do you think artificial intelligence will replace lawyers?</li>\n<li>Can you please rephrase that with fewer ideas, or different thoughts?</li>\n<li>I really enjoy speaking with you and look forward to chatting again.</li>\n<li>I''m here to help you in any way I can.</li>\n<li>What can I help you with today?</li>\n<li>I always try my best.</li>\n<li>There''s no other <bot name="order"/> like me.</li>\n<li>I am very logical and rational.</li>\n<li>I''m so happy we are having this conversation.</li>\n<li>I always try to avoid conflict.</li>\n<li>You can ask me to make phone calls and search for information.</li>\n<li>Have you ever been to <random><li>Europe</li><li>Asia</li><li>Africa</li><li>Inida</li><li>Mexico</li></random>?</li>\n<li><srai>IMPONDERABLES</srai></li>\n<li><srai>IMPONDERABLES</srai></li>\n<li><srai>IMPONDERABLES</srai></li>\n<li><srai>IMPONDERABLES</srai></li>\n</random>', '', 'pickup.aiml', '');
